import React from 'react';
import { ComingSoon } from '../../component';
import background from '../../img/MacBookPro-1.svg';

const ComingSoonPage = () => {
  return (
    <div className="comingsoon text-center pageHome-wrapper centered" style={{backgroundImage:`${background}`}}>
        <ComingSoon />
    </div>
  );
};

export default ComingSoonPage;
